import React from 'react'
import Card from 'react-bootstrap/Card'


function Cards(props) {
    

    return (
        <>  
            
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src="./img/2.jpg" />
            </Card>

        </>
    )
}

export default Cards
